openapi: 3.0.2
info:
  title: Dev Portal Tenant APIs.
  description: To onboard properly into the Fiserv Developer Studio as a tenant each
    product must support these APIs so that we can retrieve product specific API specifications
    and documentation.
  version: 1.0.1
servers:
  - url: https://tenants.fiserv.com/
paths:
  /v2/products:
    get:
      tags:
        - Tenant
      x-group-name: Tenant
      x-proxy-name: products
      summary: Returns tenant provider API.
      operationId: TenantProviderID
      responses:
        200:
          description: Tenant provider response. <a href="https://fiserv.com" rel="noopener noreferrer" target="_blank">external link</a> <a href="../docs?path=docs/getting-started/setup-tenant/setup-tenant.md">Setup Tenant</a>
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/TenantProviderResponse'
            text/yaml:
              schema:
                $ref: '#/components/schemas/TenantProviderResponse'
            text/plain:
              schema:
                $ref: '#/components/schemas/TenantProviderResponse'
  /v2/apis:
    post:
      tags:
        - Specs
      x-group-name: Specs
      x-proxy-name: apis
      summary: Returns OpenAPI Spec.
      operationId: APISpecProviderId
      requestBody:
        description: Filter Request
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/SpecsFilterRequest'
        required: false
      responses:
        200:
          description: ""
          content: {}
      x-codegen-request-body-name: Body
  /v2/docs:
    get:
      tags:
        - Documents
      x-group-name: Documents
      x-proxy-name: docs
      summary: Returns Docs in markdown format.
      operationId: DocsAPIId
      parameters:
        - in: query
          name: path
          schema:
            type: string
          required: true
          description: Markdown document path
      responses:
        200:
          description: ""
          content: {}
      x-codegen-request-body-name: Body
  /v2/layouts:
    get:
      tags:
        - Layout
      x-group-name: Layout
      x-proxy-name: layouts
      summary: Returns the product page layout.
      operationId: LayoutAPIId
      responses:
        200:
          description: This text will appear as description of your response body.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/PageLayoutResponse'
            text/yaml:
              schema:
                $ref: '#/components/schemas/PageLayoutResponse'
            text/plain:
              schema:
                $ref: '#/components/schemas/PageLayoutResponse'
  /admin-message/messages-search-details:
    get:
      tags:
        -  AdminMessage
      x-group-name: Admin
      x-proxy-name: Search
      summary: Search Admin Message details
      operationId: searchAdminMessageDetails
      parameters:
      - $ref: '#/components/parameters/messageStatus'
      - $ref: '#/components/parameters/messageName'
      - $ref: '#/components/parameters/messageDirection'
      - $ref: '#/components/parameters/eventCode'
      - $ref: '#/components/parameters/fromDate'
      - $ref: '#/components/parameters/toDate'
      - $ref: '#/components/parameters/pageIndex'
      - $ref: '#/components/parameters/pageSize'
      - $ref: '#/components/parameters/orderBy'
      - $ref: '#/components/parameters/order'
        
      responses:
        200:
          description: Search Admin Message Details
          content:
            application/json:
              schema: {$ref: '#/components/schemas/AdminMessageSearchDetails'}
              examples:
                Capture: {summary: CaptureResponse, $ref: '#/components/examples/AdminMessageSearchDetailResponse'}
 
 
        500:
          description: Internal Server error on RTP
          content: {}
      x-codegen-request-body-name: body
  /business-message/message-with-details:
    get:
      tags:
      -  BusinessMessage 
      x-group-name: Business
      x-proxy-name: Search
      summary: Search Business Message With Details 
      operationId: searchBusinessMessageWithDetails
      parameters:
        - $ref: '#/components/parameters/accNum'
        - $ref: '#/components/parameters/instrId'
        - $ref: '#/components/parameters/msgName'
        - $ref: '#/components/parameters/direction'
        - $ref: '#/components/parameters/amount'
        - $ref: '#/components/parameters/fromDate'
        - $ref: '#/components/parameters/toDate'
        - $ref: '#/components/parameters/pageIndex'
        - $ref: '#/components/parameters/pageSize'
        - $ref: '#/components/parameters/orderBy'
        - $ref: '#/components/parameters/order'
      responses:
        200:
          description: Search Business Message With Details
          content:
            application/json:
              schema: {$ref: '#/components/schemas/BusinessMessageSearchWithDetailsResult'}
              examples:
                Capture: {summary: CaptureResponse, $ref: '#/components/examples/BusinessMessageWithDetailsResponse'}              
        500:
          description: Internal Server error on xroads
          content: {}
      x-codegen-request-body-name: body
  /participant-status:
    get:
      tags:
      - Participant Status
      x-group-name: Get Participant Status
      x-proxy-name: Get
      summary: SignIn/SignOut Statuses for the signedIn Tenant
      operationId: getParticipantStatus
      responses:
        200:
          description: Participant Status
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ParticipantStatusResult'
        500:
          description: Internal Server error on xroads
          content: {}
      x-codegen-request-body-name: body

    put:
      tags:
      - Participant Status
      x-group-name: Put Participant Status
      x-proxy-name: Put
      summary: Put Request in RTB HUB Service
      operationId: updateParticipantStatus
      parameters:
        - in: query
          name: signedIn
          required: true
          schema:
            type: boolean
      responses:
        204:
          description: Request placed in queue
        500:
          description: Internal Server error on xroads
          content: {}
      x-codegen-request-body-name: body
  /participant-status/system-status:
    get:
      tags:
      - System Status
      summary: Home screen system status
      x-group-name: System
      x-proxy-name: Status
      operationId: getSystemStatus
      responses:
        200:
          description: System Status
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/SystemStatusResult'
        500:
          description: Internal Server error on RTP
          content: {}
      x-codegen-request-body-name: body
