      in: query
      description: Page Index
      required: false
      schema:
        type: integer
        default: 01
    pageSize:
      name: pageSize
      in: query
      description: Page Size
      required: false
      schema:
        type: integer
        default: 100
    orderBy:
      name: orderBy
      in: query
      description: Order By
      required: false
      schema:
        type: string
        default: AccountNumber
    order:
      name: order
      in: query
      description: Page Size
      required: false
      schema:
        type: string
        enum: [asc, desc] 
        default: asc
    accNum:
      name: accNum
      in: query
      description: accNum
      required: false
      schema:
        type: string
        pattern:  '^[a-zA-Z0-9-,.]*$'
        maxLength: 34
        default: 1234
    instrId:
      name: instrId
      in: query
      description: instrId
      required: false
      schema:
        type: string
        pattern: '^[a-zA-Z0-9]*$'
        maxLength: 35
        default: abn123
    msgName:
      name: msgName
      in: query
      description: msgName
      required: false
      schema:
        type: string
        maxLength: 40
        enum: [CAMT.029, CAMT.035, CAMT.056, PACS.002, PACS.008]
        default: CAMT.029
    direction:
      name: direction
      in: query
      description: direction
      required: false
      schema:
        type: string
        maxLength: 1
        enum: [I, O]
        default: I
    amount:
      name: amount
      in: query
      description: amount
      required: false
      schema:
        type: number
        default: 6652

